import React from "react";
import '../Weblayout/web.css';

const Sidebar =() =>{


    return(


        <>
            <aside className="side_bar">
                <ul>
                    <li>home</li>
                    <li>services</li>
                    <li>career</li>
                    <li>projects</li>
                    <li>location</li>

                </ul>
                <img src="D:\reactcls\todoapp\public\Images\wee.jpg" alt="pic4"/> 
            </aside>
        </>
    )
}
export default Sidebar ;
